import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Link from 'next/link'
import styled from 'styled-components'

const N_Link = ({url}) => {
    <Nav.Link eventKey="2"  activeClassName="active" className="tabs">
                <a as={Link} href={url} >About</a>
    </Nav.Link>
}

const StyledLink = styled(N_Link)`
    display: block;
    padding: .5rem 1rem;
    margin-bottom: -1px;
    border: 1px solid transparent;
`

export default StyledLink;
